import React from 'react'
import "./Header.css"

const Header = () => {
  return (
    <div className='h-wrapper bg-blue-100 flex'>
        <div className='h-container   justify-between '>
            {/* left side  */}
            <div className='left-side'>
                <a>
                    logo 
                </a>
            </div>
            {/* right side  */}
            <div className='right-side flex'>
                {/* menu  */}
                <a>Đăng Nhập</a>
                <a>Đăng Ký</a>
            </div>
        </div>
    </div>
  )
}

export default Header
